import axios from 'axios';
import {useEffect} from 'react';
import io from "socket.io-client";
import Cookies from 'js-cookie';

export default function ApplyTutor(props) {
    const {setDisplayNavbar, setUser} = props;
    
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                    const socket = io.connect(process.env.CLIENT_URL, {
                        query: 'session_id=' + Cookies.get('connect.sid').replace('s:','').split('.')[0]
                    });
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser])

    return <div className="wrapper">
        <div className="content" style={{flex: "0.75"}}>

        </div>
        <div className="sidebar" style={{flex: "0.25", overflow: "auto"}}>
            <video></video><br />
            <video></video><br />
            <video></video><br />
            <video></video><br />
            <video></video>
        </div>
    </div>
}
